					["4"] = {
						["AC"] = true,
						["TI"] = "Shadra's Boons",
						["TX"] = "A worshipper of the spider Loa, Shadra. She blesses Zu'tesh with the most deadly of poisons as well as enhancing his reflexes, reaction times and acrobatic skills.",
						["IC"] = "ability_hunter_pet_spider",
					},
