					["4"] = {
						["IC"] = "spell_nature_regenerate",
						["TI"] = "Blessed wid mojo.",
						["AC"] = true,
						["TX"] = "His skin is weathered and has scars littering his chest and arms and Green tattos can be seen on his skin. He looks uncannily durable for having sustained such damage.",
