		["08032059259Tolp"] = {
			["character"] = {
				["CU"] = "Relaxing after a long campaign.",
				["CO"] = "Always approachable. \nIf I don't respond please whisper me.\nStealth IC is Shadow magic.\nShadowstep is IC.\nMap IC = Reading",
				["RP"] = 1,
				["LC"] = "enUS",
