		["1014161224CwqkU"] = {
			["character"] = {
				["v"] = 58,
				["CO"] = "Hey! Feel free to walk up and chat to me, or join in on a scene!\n\nTRP is still WIP. Pre-patch boi!",
				["RP"] = 2,
				["LC"] = "enUS",
