			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Well Kempt",
						["IC"] = "INV_Misc_Comb_01",
						["TX"] = "Tannen tries to keep himself as presentable as possible. He wears tailored clothes and keeps his hair clean and tidy, which he wears loose over his shoulders these days.",
