						["AC"] = false,
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Well Off",
						["IC"] = "INV_Misc_Coin_02",
						["TX"] = "Tannen is comfortable. From fine clothes and cloaks to the jingling coinpurse at his belt, it's clear this elf has coin.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Well Mannered",
