		["0312215702RhkJ7"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Tribal Necklace",
						["IC"] = "inv_archaeology_orcclans_grontoothnecklace",
						["TX"] = "A simple string is laced around Yin'tawa's neck, with a single large shark tooth hanging from it above her collarbone. Hanging alongside it is a single blue feather.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Piercings",
						["IC"] = "INV_Jewelry_Ring_06",
						["TX"] = "Several rings adorn the upper side of Yin'tawa's ears, made entirely from bone.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Scales",
						["IC"] = "inv_misc_scales_fishblue02",
						["TX"] = "The typical Zandalari scales are present on Yin'tawa's body. Their arrangement is almost surreal in its symmetry as they lead all the way down her flanks (when visible).",
					},
					["5"] = {
						["IC"] = "INV_60Legendary_Ring1A",
						["TI"] = "The Bracelet",
						["AC"] = true,
						["TX"] = "An ornate bronze bracelet - one of a design far too expensive for her own tastes - is clasped around Yin's left wrist. In times of injury it glows a faint green colour.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Trident",
						["TX"] = "Yin'tawa's choice of weapon appears to be a functional trident made of sharpened steel and a wooden shaft adorned with stringed-up beads and small shark teeth.",
						["IC"] = "INV_Polearm_2H_KthirRelic_D_01",
